import React from 'react';

const About = () => {
  return (
    <div className="p-4 md:p-8 bg-gray-100 dark:bg-gray-900 min-h-screen">
      <h1 className="text-2xl md:text-4xl font-bold text-gray-800 dark:text-white mb-4">
        About Me
      </h1>
      <p className="text-lg md:text-xl text-gray-600 dark:text-gray-300">
        Hi, I'm a passionate developer who loves building web applications and sharing my knowledge through blogs.
      </p>
    </div>
  );
};

export default About;
